import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import client from "./metier/client";

const clients = ["e"];
 function loadClient(){
      fetch("http://localhost:8080/api/clients")
        .then(res => res.json())
        .then(
            async (result) => {
                const create = result.map(function (c) {
                    clients.push(new client(c));
                });
                return await Promise.all(create);
            },
            (error) => {console.log(error);}
        );
}

ReactDOM.render(
    console.log(loadClient()),
    <App clients={clients}/>,
    document.getElementById('page_backend'),
);
